import React from 'react';

function ProductDetails({ product }) {
  return (
    <div>
      <img src={product.image} style={{width:'300px', height: '300px'}} alt={product.title} />
      <h2>{product.title}</h2>
      <p>{product.description}</p>
      <p>Price: ${product.price}</p>
    </div>
  );
}

export default ProductDetails;
